import React from 'react';

class App extends React.Component {
  render() {
    return (
      <div>
        <h1>Contador</h1>
        <h2>0</h2>
        <button>Incrementa 1</button>
        <button>Incrementa 5</button>
      </div>
    );
  }
}

export default App;
